import React from 'react';
import './'

const Form = props =>{
     return (
         <div className="container">
             <div className="row">
                 <div className="col-md-3 offset-md-2">
                     <input type="text" className="forn-control" name="city" autoComplete="off" />
                 </div>
                 <div className="col-md-3">
                     <input type="text" className="forn-control" name="country" autoComplete="off" />
                 </div>
                 <div className="col-md-3 mt-md-0 text-md-left">
                     <button className="btn btn-warning">Get Weather</button>
                 </div>
             </div>
         </div>

     )
}

export default Form;
